import { expect } from 'chai'
import { describe, it, before } from 'mocha'
import {
  calculateRecords,
  convertData_LevelsToRuns
} from '../../src/calculations.js'

const chainId = 1
const chains = {}
chains[chainId] = {
  data: {
    tournament: {
      daysInWeek: 7,
      minDays: 3,
      startDate: null
    }
  }
}
let runs
// let tx
describe('Calculation Tests', function () {
  this.timeout(50000000)
  before(() => {
    runs = convertData_LevelsToRuns(events.data.result[0])
  })

  it('runs calculateRecords correctly, after Dec 2', async function () {
    chains[chainId].data.tournament.startDate = 1733097600 // Dec 2

    const records = calculateRecords(runs, chains, chainId)

    // filter the ones who haven't completed enough days
    const slowest = records[0].slowest.filter((r) => r.minimumDaysMet)
    const tied1 = slowest[3]
    const tied2 = slowest[4]

    expect(tied1.slowTime).to.equal(tied2.slowTime)

    const getMostRecentRecord = (a, b) => {
      return b.block_num - a.block_num
    }

    const tied1RecordSet = tied1.slowestDays.sort(getMostRecentRecord)[0]
    const tied2RecordSet = tied2.slowestDays.sort(getMostRecentRecord)[0]

    // they're tied, but one set their record earlier
    expect(tied1RecordSet.block_num).to.be.lessThan(tied2RecordSet.block_num)
  })
  it('runs calculateRecords correctly, after Dec 9', async function () {
    chains[chainId].data.tournament.startDate = 1733702400 // Dec 9
    const records = calculateRecords(runs, chains, chainId)

    // week is over so we can remove unqualified players
    const mostAverage = records[0].mostAverage.filter((r) => r.minimumDaysMet)
    const secondMostAverage = mostAverage[1]
    expect(secondMostAverage.player).to.equal(
      '0x8684eff6fa5cb3c1ad11d4ecdb0549eb2adbb57d'.toLowerCase()
    )
    const thirdMostAverage = mostAverage[2]
    expect(thirdMostAverage.player).to.equal(
      '0xC07C43cbC70c05bAcFc1F13636d0DB2193475153'.toLowerCase()
    )

    // they're tied, but one set their record earlier
    expect(secondMostAverage.average).to.equal(thirdMostAverage.average)
    expect(secondMostAverage.lastPlayed).to.be.lessThan(
      thirdMostAverage.lastPlayed
    )
  })

  it('runs calculateRecords correctly, mid-week Dec 16', async function () {
    chains[chainId].data.tournament.startDate = 1734307200 // Dec 16
    const records = calculateRecords(runs, chains, chainId)
    // 0x5b is fastest even tho they haven't met minimum days
    // because tournament hasn't entered Friday zone
    expect(records[0].fastest[0].player).to.equal(
      '0x5b1b8283b0c9fdf0de950b891ee97cc151345c16'
    )
    expect(records[0].fastest[0].minimumDaysMet).to.equal(false)
  })

  it('doesnt repeat any records, since Dec 2', async function () {
    chains[chainId].data.tournament.startDate = 1733097600 // Dec 2
    const records = calculateRecords(runs, chains, chainId)
    Object.values(records).forEach((record) => {
      const recordsBroken = record.recordsBroken
      let lastSpeedy, lastMiddy, lastSavory
      recordsBroken.forEach((record) => {
        if (record.type === 'fastest') {
          expect(record.player).to.not.equal(lastSpeedy)
          lastSpeedy = record.player
        } else if (record.type === 'mostAverage') {
          expect(record.player).to.not.equal(lastMiddy)
          lastMiddy = record.player
        } else if (record.type === 'slowest') {
          expect(record.player).to.not.equal(lastSavory)
          lastSavory = record.player
        }
      })
    })
  })
})

